[{"location":"#Patchwork.jl","page":"Home","title":"Patchwork.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create interactive, self-contained HTML dashboards with Julia. Patchwork generates single-page applications with Vue.js reactivity, Tailwind CSS styling, and a powerful plugin system for any JavaScript library.","category":"page"},{"location":"#Features","page":"Home","title":"Features","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Self-contained HTML files - Share dashboards anywhere, no server required\nTabbed interface with search and mobile support\nBuilt-in plugins - Markdown, Chart.js, Highcharts, Plotly, Leaflet, Mermaid\nPlugin system - Integrate any JavaScript library with five simple functions\nZero configuration - Works out of the box","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"using Pkg\nPkg.add(\"Patchwork\")","category":"page"},{"location":"#Quick-Start","page":"Home","title":"Quick Start","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"using Patchwork\n\ndashboard = Patchwork.Dashboard(\n    \"My Dashboard\",\n    [\n        Patchwork.Tab(\n            \"Overview\",\n            [\n                Patchwork.Markdown(\"\"\"\n                # Welcome to Patchwork.jl\n\n                Create beautiful dashboards with:\n                - Interactive charts\n                - Maps\n                - Diagrams\n                - Custom content\n                \"\"\"),\n            ],\n        ),\n    ],\n)\n\nsave(dashboard, \"dashboard.html\")","category":"page"},{"location":"#Core-Concepts","page":"Home","title":"Core Concepts","text":"","category":"section"},{"location":"#Dashboard","page":"Home","title":"Dashboard","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"A Dashboard contains a title, tabs, and optional custom CSS:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Dashboard(title::String, tabs::Vector{Tab}; custom_css::String = \"\")","category":"page"},{"location":"#Tab","page":"Home","title":"Tab","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"A Tab contains a label and a vector of plugins:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Tab(label::String, plugins::Vector{Plugin})","category":"page"},{"location":"#Plugin","page":"Home","title":"Plugin","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"All content types inherit from the abstract Plugin type. Built-in plugins include:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Markdown - Rendered markdown with syntax highlighting\nChartJs - Chart.js visualizations\nHighcharts - Highcharts visualizations\nPlotly - Plotly charts and maps\nLeaflet - Interactive maps\nMermaid - Diagrams and flowcharts\nHTML - Raw HTML content","category":"page"},{"location":"#Built-in-Plugins","page":"Home","title":"Built-in Plugins","text":"","category":"section"},{"location":"#Markdown","page":"Home","title":"Markdown","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Render markdown with syntax highlighting for code blocks.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Markdown(\"\"\"\n# Title\n\n**Bold text** and *italic text*\n\n- List item 1\n- List item 2\n","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia println(\"Code with syntax highlighting\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"\"\"\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"The Markdown plugin uses Julia's built-in Markdown parser and includes Highlight.js for code syntax highlighting.","category":"page"},{"location":"#Chart.js","page":"Home","title":"Chart.js","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create interactive charts using Chart.js. Always use Dict{String,Any} for type safety.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.ChartJs(\n    title::String,\n    chart_type::String,\n    data::Dict{String,Any};\n    options::Dict{String,Any} = Dict{String,Any}()\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Bar Chart:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.ChartJs(\n    \"Sales by Quarter\",\n    \"bar\",\n    Dict{String,Any}(\n        \"labels\" => [\"Q1\", \"Q2\", \"Q3\", \"Q4\"],\n        \"datasets\" => [\n            Dict{String,Any}(\n                \"label\" => \"2024\",\n                \"data\" => [12, 19, 8, 15],\n                \"backgroundColor\" => \"rgba(54, 162, 235, 0.5)\",\n            ),\n        ],\n    ),\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Doughnut Chart:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.ChartJs(\n    \"Traffic Sources\",\n    \"doughnut\",\n    Dict{String,Any}(\n        \"labels\" => [\"Direct\", \"Social\", \"Organic\", \"Referral\"],\n        \"datasets\" => [\n            Dict{String,Any}(\n                \"data\" => [300, 150, 200, 100],\n                \"backgroundColor\" => [\"#FF6384\", \"#36A2EB\", \"#FFCE56\", \"#4BC0C0\"],\n            ),\n        ],\n    ),\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Supported chart types: line, bar, radar, doughnut, pie, polarArea, bubble, scatter","category":"page"},{"location":"#Highcharts","page":"Home","title":"Highcharts","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create Highcharts visualizations.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Highcharts(\n    title::String,\n    config::Dict{String,Any}\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Line Chart:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Highcharts(\n    \"Monthly Performance\",\n    Dict{String,Any}(\n        \"chart\" => Dict(\"type\" => \"line\"),\n        \"xAxis\" => Dict(\"categories\" => [\"Jan\", \"Feb\", \"Mar\", \"Apr\", \"May\", \"Jun\"]),\n        \"yAxis\" => Dict(\"title\" => Dict(\"text\" => \"Value\")),\n        \"series\" => [\n            Dict(\"name\" => \"Series A\", \"data\" => [29, 71, 106, 129, 144, 176]),\n            Dict(\"name\" => \"Series B\", \"data\" => [50, 80, 95, 110, 130, 150]),\n        ],\n    ),\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Column Chart:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Highcharts(\n    \"Distribution\",\n    Dict{String,Any}(\n        \"chart\" => Dict(\"type\" => \"column\"),\n        \"xAxis\" => Dict(\"categories\" => [\"Alpha\", \"Beta\", \"Gamma\", \"Delta\"]),\n        \"series\" => [\n            Dict(\"name\" => \"Values\", \"data\" => [5, 3, 4, 7]),\n        ],\n    ),\n)","category":"page"},{"location":"#Plotly","page":"Home","title":"Plotly","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create Plotly charts with support for 3D plots, maps, and scientific visualizations.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Plotly(\n    title::String,\n    data::Vector{Dict{String,Any}};\n    layout::Dict{String,Any} = Dict{String,Any}(),\n    config::Dict{String,Any} = Dict{String,Any}()\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Scatter Plot:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Plotly(\n    \"Scatter Analysis\",\n    [\n        Dict{String,Any}(\n            \"x\" => [1, 2, 3, 4, 5, 6],\n            \"y\" => [1, 4, 9, 16, 25, 36],\n            \"mode\" => \"markers+lines\",\n            \"type\" => \"scatter\",\n            \"name\" => \"Quadratic\",\n        ),\n    ],\n    layout = Dict{String,Any}(\n        \"xaxis\" => Dict(\"title\" => \"X\"),\n        \"yaxis\" => Dict(\"title\" => \"YÂ²\"),\n    ),\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - 3D Surface:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Plotly(\n    \"3D Surface\",\n    [\n        Dict{String,Any}(\n            \"z\" => [[1, 2, 3], [2, 3, 4], [3, 4, 5]],\n            \"type\" => \"surface\",\n        ),\n    ],\n    layout = Dict{String,Any}(\"title\" => \"3D Surface Plot\"),\n)","category":"page"},{"location":"#Leaflet","page":"Home","title":"Leaflet","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create interactive maps with markers and popups.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Leaflet(\n    title::String,\n    center::Tuple{Float64,Float64};\n    zoom::Int = 13,\n    markers::Vector{Dict{String,Any}} = Dict{String,Any}[],\n    options::Dict{String,Any} = Dict{String,Any}()\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Simple Map:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Leaflet(\n    \"New York City\",\n    (40.7128, -74.0060),\n    zoom = 12,\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Map with Markers:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Leaflet(\n    \"Major US Cities\",\n    (39.8283, -98.5795),\n    zoom = 4,\n    markers = [\n        Dict{String,Any}(\n            \"lat\" => 40.7128,\n            \"lng\" => -74.0060,\n            \"popup\" => \"<b>New York</b><br>Population: 8.3M\",\n        ),\n        Dict{String,Any}(\n            \"lat\" => 34.0522,\n            \"lng\" => -118.2437,\n            \"popup\" => \"<b>Los Angeles</b><br>Population: 4.0M\",\n        ),\n    ],\n)","category":"page"},{"location":"#Mermaid","page":"Home","title":"Mermaid","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create diagrams using Mermaid syntax.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Mermaid(\n    title::String,\n    diagram::String;\n    theme::String = \"default\"\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Flowchart:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Mermaid(\n    \"System Architecture\",\n    \"\"\"\n    graph TD\n        A[Client] --> B[Load Balancer]\n        B --> C[Server 1]\n        B --> D[Server 2]\n    \"\"\",\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example - Sequence Diagram:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Mermaid(\n    \"Authentication Flow\",\n    \"\"\"\n    sequenceDiagram\n        participant U as User\n        participant A as App\n        participant S as Server\n        U->>A: Login\n        A->>S: Authenticate\n        S-->>A: Token\n        A-->>U: Success\n    \"\"\",\n)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Supported diagram types: flowcharts, sequence diagrams, class diagrams, state diagrams, ER diagrams, Gantt charts, and more.","category":"page"},{"location":"#HTML","page":"Home","title":"HTML","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Include raw HTML content with access to Tailwind CSS classes.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.HTML(content::String)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Example:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.HTML(\"\"\"\n<div class=\"p-6 bg-gradient-to-r from-blue-500 to-purple-600 rounded-lg shadow-xl\">\n    <h2 class=\"text-2xl font-bold text-white mb-2\">Custom Component</h2>\n    <p class=\"text-blue-100\">Styled with Tailwind CSS</p>\n</div>\n\"\"\")","category":"page"},{"location":"#Creating-Custom-Plugins","page":"Home","title":"Creating Custom Plugins","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Create a plugin for any JavaScript library by implementing five functions (one required, four optional):","category":"page"},{"location":"#Plugin-Interface","page":"Home","title":"Plugin Interface","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"# Required: Convert plugin to HTML\nto_html(plugin::MyPlugin) = \"<div>...</div>\"\n\n# Optional: CSS dependencies (CDN URLs)\ncss_deps(::Type{MyPlugin}) = [\"https://cdn.example.com/lib.css\"]\n\n# Optional: JavaScript dependencies (CDN URLs)\njs_deps(::Type{MyPlugin}) = [\"https://cdn.example.com/lib.js\"]\n\n# Optional: JavaScript initialization code (runs on mount)\ninit_script(::Type{MyPlugin}) = \"// init code\"\n\n# Optional: Custom CSS styles\ncss(::Type{MyPlugin}) = \"/* custom styles */\"","category":"page"},{"location":"#Example:-DataTables-Plugin","page":"Home","title":"Example: DataTables Plugin","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"module DataTablesPlugin\n\nimport ..Plugin, ..to_html, ..css_deps, ..js_deps, ..init_script, ..css\nusing JSON\nexport DataTable\n\nstruct DataTable <: Plugin\n    title::String\n    data::Vector{Vector{Any}}\n    columns::Vector{String}\nend\n\nfunction to_html(plugin::DataTable)\n    headers = join([\"<th>$(col)</th>\" for col in plugin.columns], \"\")\n    rows = join([\n        \"<tr>\" * join([\"<td>$(cell)</td>\" for cell in row], \"\") * \"</tr>\"\n        for row in plugin.data\n    ], \"\")\n\n    return \"\"\"\n    <div>\n        <h3 class=\"text-lg font-semibold mb-4\">$(plugin.title)</h3>\n        <table class=\"datatable display\" style=\"width:100%\">\n            <thead><tr>$headers</tr></thead>\n            <tbody>$rows</tbody>\n        </table>\n    </div>\n    \"\"\"\nend\n\ncss_deps(::Type{DataTable}) = [\n    \"https://cdn.datatables.net/1.13.7/css/jquery.dataTables.min.css\"\n]\n\njs_deps(::Type{DataTable}) = [\n    \"https://code.jquery.com/jquery-3.7.0.min.js\",\n    \"https://cdn.datatables.net/1.13.7/js/jquery.dataTables.min.js\"\n]\n\ninit_script(::Type{DataTable}) = \"\"\"\n    document.querySelectorAll('.datatable').forEach(table => {\n        $(table).DataTable();\n    });\n\"\"\"\n\ncss(::Type{DataTable}) = \"\"\n\nend","category":"page"},{"location":"#Integrating-Custom-Plugins","page":"Home","title":"Integrating Custom Plugins","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Add your plugin module to src/Patchwork.jl:","category":"page"},{"location":"","page":"Home","title":"Home","text":"include(\"plugins/datatables.jl\")\nusing .DataTablesPlugin","category":"page"},{"location":"","page":"Home","title":"Home","text":"Then use it like any built-in plugin:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Patchwork.DataTable(\n    \"Sales Data\",\n    [\n        [\"John\", \"Sales\", 50000],\n        [\"Jane\", \"Marketing\", 60000],\n        [\"Bob\", \"Engineering\", 75000],\n    ],\n    [\"Name\", \"Department\", \"Salary\"]\n)","category":"page"},{"location":"#API-Reference","page":"Home","title":"API Reference","text":"","category":"section"},{"location":"#Types","page":"Home","title":"Types","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"abstract type Plugin end","category":"page"},{"location":"","page":"Home","title":"Home","text":"Base type for all plugins. Custom plugins must subtype Plugin.","category":"page"},{"location":"","page":"Home","title":"Home","text":"struct Tab\n    label::String\n    plugins::Vector{Plugin}\nend","category":"page"},{"location":"","page":"Home","title":"Home","text":"Represents a tab in the dashboard containing a label and vector of plugins.","category":"page"},{"location":"","page":"Home","title":"Home","text":"struct Dashboard\n    title::String\n    tabs::Vector{Tab}\n    custom_css::String\n\n    Dashboard(title::String, tabs::Vector{Tab}; custom_css::String = \"\")\nend","category":"page"},{"location":"","page":"Home","title":"Home","text":"Main dashboard type containing title, tabs, and optional custom CSS.","category":"page"},{"location":"#Functions","page":"Home","title":"Functions","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"save(dashboard::Dashboard, path::String)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Generate complete HTML and save to file.","category":"page"},{"location":"","page":"Home","title":"Home","text":"to_html(plugin::Plugin) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Convert plugin to HTML string. Must be implemented for all custom plugins.","category":"page"},{"location":"","page":"Home","title":"Home","text":"css_deps(::Type{<:Plugin}) -> Vector{String}","category":"page"},{"location":"","page":"Home","title":"Home","text":"Return vector of CSS dependency URLs. Default: String[]","category":"page"},{"location":"","page":"Home","title":"Home","text":"js_deps(::Type{<:Plugin}) -> Vector{String}","category":"page"},{"location":"","page":"Home","title":"Home","text":"Return vector of JavaScript dependency URLs. Default: String[]","category":"page"},{"location":"","page":"Home","title":"Home","text":"init_script(::Type{<:Plugin}) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Return JavaScript initialization code. Default: \"\"","category":"page"},{"location":"","page":"Home","title":"Home","text":"css(::Type{<:Plugin}) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Return custom CSS styles. Default: \"\"","category":"page"},{"location":"","page":"Home","title":"Home","text":"get_plugin_type(plugin::Plugin) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Get lowercase plugin type name for internal use.","category":"page"},{"location":"","page":"Home","title":"Home","text":"escape_html(s::String) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Escape HTML special characters (&, <, >, \", ').","category":"page"},{"location":"","page":"Home","title":"Home","text":"generate_html(dashboard::Dashboard) -> String","category":"page"},{"location":"","page":"Home","title":"Home","text":"Generate complete HTML string for dashboard (used internally by save).","category":"page"},{"location":"#Advanced-Usage","page":"Home","title":"Advanced Usage","text":"","category":"section"},{"location":"#Multiple-Tabs-with-Mixed-Content","page":"Home","title":"Multiple Tabs with Mixed Content","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"dashboard = Patchwork.Dashboard(\n    \"Analytics Dashboard\",\n    [\n        Patchwork.Tab(\"Overview\", [\n            Patchwork.Markdown(\"# Executive Summary\"),\n            Patchwork.ChartJs(\n                \"Revenue\",\n                \"line\",\n                Dict{String,Any}(...),\n            ),\n        ]),\n        Patchwork.Tab(\"Geographic\", [\n            Patchwork.Leaflet(\n                \"Sales by Region\",\n                (37.0, -95.0),\n                markers = [...],\n            ),\n        ]),\n        Patchwork.Tab(\"Architecture\", [\n            Patchwork.Mermaid(\n                \"System Design\",\n                \"graph TD\\n...\",\n            ),\n        ]),\n    ],\n)","category":"page"},{"location":"#Custom-Styling","page":"Home","title":"Custom Styling","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Add custom CSS to modify dashboard appearance:","category":"page"},{"location":"","page":"Home","title":"Home","text":"dashboard = Patchwork.Dashboard(\n    \"Branded Dashboard\",\n    tabs,\n    custom_css = \"\"\"\n    :root {\n        --primary-color: #667eea;\n        --secondary-color: #764ba2;\n    }\n\n    .sidebar {\n        background: linear-gradient(to bottom, var(--primary-color), var(--secondary-color));\n    }\n\n    h1, h2, h3 {\n        color: var(--primary-color);\n    }\n    \"\"\",\n)","category":"page"},{"location":"#Combining-Multiple-Chart-Libraries","page":"Home","title":"Combining Multiple Chart Libraries","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Patchwork.Tab(\n    \"Comparison\",\n    [\n        Patchwork.Markdown(\"## Chart.js vs Plotly\"),\n        Patchwork.ChartJs(\"Chart.js Line\", \"line\", ...),\n        Patchwork.Plotly(\"Plotly Line\", [...]),\n        Patchwork.Markdown(\"## Highcharts Implementation\"),\n        Patchwork.Highcharts(\"Highcharts Line\", ...),\n    ],\n)","category":"page"},{"location":"#Type-Safety","page":"Home","title":"Type Safety","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Always use Dict{String,Any} for chart configurations to avoid type inference issues:","category":"page"},{"location":"","page":"Home","title":"Home","text":"# â Correct\nDict{String,Any}(\"labels\" => [...], \"datasets\" => [...])\n\n# â Wrong - may cause type errors\nDict(\"labels\" => [...], \"datasets\" => [...])","category":"page"},{"location":"#Architecture","page":"Home","title":"Architecture","text":"","category":"section"},{"location":"#HTML-Generation","page":"Home","title":"HTML Generation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Patchwork generates self-contained single-page applications with:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Dependency Collection - Automatically collects all CSS/JS dependencies from plugins\nVue.js Integration - Creates reactive UI with tab switching and search\nTailwind CSS - Provides utility-first styling via CDN\nPlugin Initialization - Runs all plugin init scripts on mount\nMobile Support - Responsive design with hamburger menu","category":"page"},{"location":"#Plugin-System-Design","page":"Home","title":"Plugin System Design","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Plugins use a simple interface pattern:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Declarative - Define HTML structure, dependencies, and initialization\nComposable - Mix different plugins in tabs\nExtensible - Add new plugins without modifying core\nType-safe - Strong typing with Julia's type system","category":"page"},{"location":"#Output-Format","page":"Home","title":"Output Format","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Generated HTML includes:","category":"page"},{"location":"","page":"Home","title":"Home","text":"All CSS dependencies in <head>\nAll JavaScript dependencies before closing </body>\nVue.js application with reactive data\nEmbedded plugin content and configuration\nCustom CSS if provided\nComplete standalone file (no external data dependencies)","category":"page"},{"location":"#Contributing","page":"Home","title":"Contributing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Contributions are welcome! Areas for contribution:","category":"page"},{"location":"","page":"Home","title":"Home","text":"New built-in plugins\nDocumentation improvements\nBug fixes\nPerformance optimizations\nExample dashboards","category":"page"},{"location":"","page":"Home","title":"Home","text":"Please open an issue or submit a pull request on GitHub.","category":"page"},{"location":"#License","page":"Home","title":"License","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"MIT License","category":"page"}]
